"use strict";function scheduleAppointment(){var n=1,t=1,e=1,i=1,o=1,c={patient_id:n,provider_id:t,location_id:e,appointment_type:i,appointment_time:o};$.ajax({url:"/appointments/schedule",type:"GET",data:$.param(c),contentType:"text/html",async:!1,success:function(n){$(".appointment_confirm").hide(),$(".appointment_confirmed").show()},error:function(){},cache:!1,processData:!1})}$(document).ready(function(){$(".appointment_confirmed").hide(),$("#confirm_appointment").on("click",function(){scheduleAppointment()}),$("#schedule_new_patient").on("click",function(){$("#form_schedule_another_appointment").submit()}),$("#cancel_appointment").on("click",function(){$("#form_schedule_another_appointment").submit()})});
